eval("module.exports = JSON.parse(\"{\\\"items\\\":[{\\\"name\\\":\\\"Aly's Wedding\\\",\\\"description\\\":\\\"Last Fall, my step sister Aly got married! It was over in Newport at Fort Adams, which was beautiful, but she was super busy and we hardly saw her. We had some good fun in the fort though.\\\",\\\"date\\\":\\\"Fall 2018\\\",\\\"paths\\\":[\\\"/alysWedding/alyWedding1.jpg\\\",\\\"/alysWedding/alyWedding2.jpg\\\",\\\"/alysWedding/alyWedding3.jpg\\\",\\\"/alysWedding/alyWedding4.jpg\\\",\\\"/alysWedding/alyWedding5.jpg\\\",\\\"/alysWedding/alyWedding6.jpg\\\",\\\"/alysWedding/alyWedding7.jpg\\\",\\\"/alysWedding/alyWedding8.jpg\\\",\\\"/alysWedding/alyWedding9.jpg\\\",\\\"/alysWedding/alyWedding10.jpg\\\",\\\"/alysWedding/alyWedding11.jpg\\\",\\\"/alysWedding/alyWedding12.jpg\\\",\\\"/alysWedding/alyWedding13.jpg\\\",\\\"/alysWedding/alyWedding14.jpg\\\",\\\"/alysWedding/alyWedding15.jpg\\\",\\\"/alysWedding/alyWedding16.jpg\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Ayah Mccray\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"I too have been thinking about undergoing the netty pot olympics!\\\"},{\\\"user\\\":\\\"Elicia Abbott\\\",\\\"rating\\\":1,\\\"comment\\\":\\\"That fort isnt looking up to standards, I hardly see how it could withstand a cannonball\\\"},{\\\"user\\\":\\\"Inaaya Lin\\\",\\\"rating\\\":3,\\\"comment\\\":\\\"Looks like fun but wheres the married couple\\\"},{\\\"user\\\":\\\"Clark Mcdonald\\\",\\\"rating\\\":2,\\\"comment\\\":\\\"I don't care for kleenex, they're proven to make your nose more runny. You have to use a handkerchief instead. Ok pictures\\\"},{\\\"user\\\":\\\"Natalie Nichols\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"Fit check on that vampire queen !!!\\\"}]},{\\\"name\\\":\\\"Baby Me\\\",\\\"description\\\":\\\"Found some old pictures of myself around. Just a couple of the classics, me with a toy gun, me on a swing, a before and after of me when this kid paul sat next to me at my kindergarten boat competition (I was so proud of my boat, but I didn't want to sit with paul)\\\",\\\"date\\\":\\\"My early years\\\",\\\"paths\\\":[\\\"/babyMe/babyMe.JPG\\\",\\\"/babyMe/babyMe2.JPG\\\",\\\"/babyMe/babyMe3.JPG\\\",\\\"/babyMe/babyMe4.JPG\\\",\\\"/babyMe/babyMe5.JPG\\\",\\\"/babyMe/babyMe6.JPG\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Caspian Huber\\\",\\\"rating\\\":4,\\\"comment\\\":\\\"Cute kid. Cheer up\\\"},{\\\"user\\\":\\\"Persephone Wang\\\",\\\"rating\\\":2,\\\"comment\\\":\\\"Did these get developed at cvs or something?? What's going on here. Have you even heard of one of the mega pixels??\\\"},{\\\"user\\\":\\\"Reggie Schwartz\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"Haha! nice watch kiddo\\\"}]},{\\\"name\\\":\\\"Bonnie\\\",\\\"description\\\":\\\"Bonnie is my mother! Just wanted to grab a couple memories of her. We've got the timeless mercury video, the mcdonalds sequence, her sock man for Kevin, and her last Halloween costume\\\",\\\"date\\\":\\\"Past couple years\\\",\\\"paths\\\":[\\\"/bonnie/bonnie1.JPG\\\",\\\"/bonnie/bonnie2.jpg\\\",\\\"/bonnie/bonnie3.jpg\\\",\\\"/bonnie/bonnie4.jpg\\\",\\\"/bonnie/bonnie5.MOV\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Maha Davila\\\",\\\"rating\\\":4,\\\"comment\\\":\\\"I've done extensive tesrs on mercury content in eyes! Turns out tht there is a count of 50ml / oz which is similar to that of a shark. This lady has very sgrong intuition\\\"},{\\\"user\\\":\\\"Franciszek Olsen\\\",\\\"rating\\\":2,\\\"comment\\\":\\\"My eyes have no chemicals\\\"},{\\\"user\\\":\\\"Sawyer\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"Is macdognolgds is healpy?\\\"}]},{\\\"name\\\":\\\"Chelsea\\\",\\\"description\\\":\\\"In sophomore year, I had the chance to meet Chelsea Manning with a group of students before she gave a bigger talk to the campus. She's really amazing and brilliant, and getting to sit around and talk neural networks / tensorflow with one of my personal heroes was one of the most incredible experiences.\\\",\\\"date\\\":\\\"Spring 2018\\\",\\\"paths\\\":[\\\"/chelseaManning1.PNG\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Aroush Vega\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"I miss her! Please write to her, it means a lot\\\"},{\\\"user\\\":\\\"Hudson Jacobs\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"She's absolutely brilliant and kind, comp sci queen tbh\\\"},{\\\"user\\\":\\\"Quentin Owen\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"Free her.\\\"}]},{\\\"name\\\":\\\"Alpha Brains\\\",\\\"description\\\":\\\"Summer going into my junior year I had an internship at Cigna, and I met some of my closest friends there! Everyone was on my team (well, Hanna was peripherally), and we pretty quickly got to be close out of the office. Being around them (Andi not pictured :( ) is always super refreshing, and seeing them is one of my favorite parts of going home.\\\",\\\"date\\\":\\\"Summer 2018 and on\\\",\\\"paths\\\":[\\\"/cignaPals/cignaPals.jpg\\\",\\\"/cignaPals/cignaPals2.jpg\\\",\\\"/cignaPals/cignaPals3.jpg\\\",\\\"/cignaPals/cignaPals4.jpg\\\",\\\"/cignaPals/cignaPals5.jpg\\\",\\\"/cignaPals/cignaPals6.jpg\\\",\\\"/cignaPals/cignaPals7.jpg\\\",\\\"/cignaPals/cignaPals8.jpg\\\",\\\"/cignaPals/cignaPals9.jpg\\\",\\\"/cignaPals/cignaPals10.jpg\\\",\\\"/cignaPals/cignaPals11.jpg\\\",\\\"/cignaPals/cignaPals12.jpg\\\",\\\"/cignaPals/cignaPals13.jpg\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Komal Valdez\\\",\\\"rating\\\":2,\\\"comment\\\":\\\"Some of them look fine, but that one guy looks suspicious\\\"},{\\\"user\\\":\\\"Nikodem Barber\\\",\\\"rating\\\":1,\\\"comment\\\":\\\"Tim said I have a 'fundamental misunderstanding of the box model.' What an asshole\\\"},{\\\"user\\\":\\\"Aedan Vickers\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"Pooky is so cute!\\\"},{\\\"user\\\":\\\"Manav Todd\\\",\\\"rating\\\":4,\\\"comment\\\":\\\"I like the frogs\\\"}]},{\\\"name\\\":\\\"family\\\",\\\"description\\\":\\\"Just some miscellanious family pictures, or some of us all together :)\\\",\\\"date\\\":\\\"98 and on\\\",\\\"paths\\\":[\\\"/family/family.JPG\\\",\\\"/family/family2.jpg\\\",\\\"/family/family3.jpg\\\",\\\"/family/family4.jpg\\\",\\\"/family/family5.jpg\\\",\\\"/family/family6.jpg\\\",\\\"/family/family7.JPG\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Rahima Davies\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"Nice family\\\"},{\\\"user\\\":\\\"Malik Aldred\\\",\\\"rating\\\":2,\\\"comment\\\":\\\"Looks like a ten year gap... what gives\\\"}]},{\\\"name\\\":\\\"Queer Coffeehouse\\\",\\\"description\\\":\\\"These are my near and dear Bard friends. We all met in L&T, and got a suite together in sophomore year. I love them all very dearly\\\",\\\"date\\\":\\\"Fall 2016 and on\\\",\\\"paths\\\":[\\\"/friends/friends1.JPG\\\",\\\"/friends/friends2.JPG\\\",\\\"/friends/friends3.JPG\\\",\\\"/friends/friendsParkingLot1.JPG\\\",\\\"/friends/friendsParkingLot2.JPG\\\",\\\"/friends/friendsParkingLot3.JPG\\\",\\\"/friends/friendsParkingLot4.JPG\\\",\\\"/friends/friendsParkingLot5.JPG\\\",\\\"/friends/theaDino.jpg\\\",\\\"/friends/theaHands.JPG\\\",\\\"/friends/theaHome.JPG\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Johnnie Holman\\\",\\\"rating\\\":4,\\\"comment\\\":\\\"Outside shots are nice\\\"},{\\\"user\\\":\\\"Terri Reader\\\",\\\"rating\\\":2,\\\"comment\\\":\\\"I went to bread alone once, and it was filled with people. I just want to be alone with thne bread...\\\"},{\\\"user\\\":\\\"Elle Handley\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"Omg I love the face masks! You look like robbers LOL\\\"}]},{\\\"name\\\":\\\"Garlic Fest\\\",\\\"description\\\":\\\"Last year, Mary, Thea, and I all went to garlic fest together! It was really fun, but I only brought 10 dollars in cash and couldn't try too much of the goods, but it was a great day to be out with my pals\\\",\\\"date\\\":\\\"Fall 2018\\\",\\\"paths\\\":[\\\"/garlicFest/garlicFest1.jpg\\\",\\\"/garlicFest/garlicFest2.jpg\\\",\\\"/garlicFest/garlicFest3.jpg\\\",\\\"/garlicFest/garlicFest4.jpg\\\",\\\"/garlicFest/garlicFest5.jpg\\\",\\\"/garlicFest/garlicFest6.jpg\\\",\\\"/garlicFest/garlicFest7.jpg\\\",\\\"/garlicFest/garlicFest8.jpg\\\",\\\"/garlicFest/garlicFest9.jpg\\\",\\\"/garlicFest/garlicFest10.jpg\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Danyal Larson\\\",\\\"rating\\\":3,\\\"comment\\\":\\\"Looks like a pretty fun time, but I bet its smelly. so I dont know if it is for me\\\"},{\\\"user\\\":\\\"Phil Penn\\\",\\\"rating\\\":4,\\\"comment\\\":\\\"can this fit a big car if it has garlic?\\\"},{\\\"user\\\":\\\"Parris Prince\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"Tried the vinegar... How long before you have to call a doctor, am I right??\\\"}]},{\\\"name\\\":\\\"Leor\\\",\\\"description\\\":\\\"One day last spring, Leor asked if I could be part of a photoshoot for her. Of course you say yes to these things, and we ended up wading through the Tivoli Bays fresh into spring (the water was quite cold). I never actually saw the pictures that she got out of it, but I had this funky aluminum cloak for it\\\",\\\"date\\\":\\\"Spring 2019\\\",\\\"paths\\\":[\\\"/leor/leor1.jpg\\\",\\\"/leor/leor2.jpg\\\",\\\"/leor/leor3.jpg\\\",\\\"/leor/leor4.jpg\\\",\\\"/leor/leor5.jpg\\\",\\\"/leor/leor6.jpg\\\",\\\"/leor/leor7.jpg\\\",\\\"/leor/leor8.jpg\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Anwen Mayer\\\",\\\"rating\\\":4,\\\"comment\\\":\\\"Nice creek\\\"}]},{\\\"name\\\":\\\"Mary's Plants\\\",\\\"description\\\":\\\"Mary got these plants and a little growth apparatus for our home in\\\\nsophomore year, it was super cute and I loved it. Only basil really grew, and\\\\ncurly parsley consistently dissapointed us.\\\",\\\"date\\\":\\\"Feb 19, 2018\\\",\\\"paths\\\":[\\\"/maryPlant/maryPlant1.JPG\\\",\\\"/maryPlant/maryPlant2.JPG\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Declan James\\\",\\\"rating\\\":4,\\\"comment\\\":\\\"How come the parsleys didnot grow\\\"},{\\\"user\\\":\\\"Philippa Hurst\\\",\\\"rating\\\":3,\\\"comment\\\":\\\"is basil stealing the vitamins?\\\"},{\\\"user\\\":\\\"Blossom Amin\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"I used to have one of these, and it worked great. I think you just have to give it filtered water, lord knows around where I'm from there's a pretty high lead concentration in the water, wouldn't want that with the plants\\\"}]},{\\\"name\\\":\\\"Cancun's Night\\\",\\\"description\\\":\\\"Nothing too special, just a night at cancuns with my pals\\\",\\\"date\\\":\\\"Spring 2019\\\",\\\"paths\\\":[\\\"/maryTheaCancuns/maryTheaCancuns1.JPG\\\",\\\"/maryTheaCancuns/maryTheaCancuns2.JPG\\\",\\\"/maryTheaCancuns/maryTheaCancuns3.JPG\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Grady Buchanan\\\",\\\"rating\\\":2,\\\"comment\\\":\\\"I saw them not card some pretty young looking fellas the other night...\\\"},{\\\"user\\\":\\\"Isobella Arellano\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"Used to pop in to grab a marg or two before german class, mogul moves only baybee\\\"}]},{\\\"name\\\":\\\"Trip to the MET\\\",\\\"description\\\":\\\"We took a trip down to the city for our Roman Art and Architecture class, which is where I met Anna and Isabel! It was fun, a wonderful time, Lucius Verus is a cutie\\\",\\\"date\\\":\\\"Spring 2018\\\",\\\"paths\\\":[\\\"/met/met1.JPG\\\",\\\"/met/met2.JPG\\\",\\\"/met/met3.JPG\\\",\\\"/met/met4.JPG\\\",\\\"/met/met5.JPG\\\",\\\"/met/met6.JPG\\\",\\\"/met/met7.JPG\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Mathilda Valenzuela\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"I love the met! Its so much better when you're a new york resident too. I wish the guggenheim was a little cheaper though\\\"}]},{\\\"name\\\":\\\"Microwave Computer\\\",\\\"description\\\":\\\"Hunter and I built a computer in a microwave! It was good fun, we enlisted\\\\nmy buddy to do some metal work—he cut the hole for the IO shield—and we payed\\\\nhim by letting him keep all the innards. Perhaps he's on a government watch list\\\\nnow, but you never know!\\\",\\\"date\\\":\\\"Feb 2, 2018\\\",\\\"paths\\\":[\\\"/microwave/microwave1.JPG\\\",\\\"/microwave/microwave2.JPG\\\",\\\"/microwave/microwave3.JPG\\\",\\\"/microwave/microwave4.JPG\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Aleisha Morse\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"Holy shit, yall are wild for this one! So cool\\\"},{\\\"user\\\":\\\"Mila-Rose Southern\\\",\\\"rating\\\":3,\\\"comment\\\":\\\"Can it still cook stuff\\\"},{\\\"user\\\":\\\"Aliya Williams\\\",\\\"rating\\\":2,\\\"comment\\\":\\\"I dont understand what a computer is, and I will ask the same question about how this is a computer that you have heard hundreds of times\\\"}]},{\\\"name\\\":\\\"Dad\\\",\\\"description\\\":\\\"My dad's family came here from Haiti when he was a little kid. He was spiffy then, he's spiffy now. He's always kept our home full of art, and always feel loved when I'm there\\\",\\\"date\\\":\\\"way back then\\\",\\\"paths\\\":[\\\"/richard/dadKatia1.PNG\\\",\\\"/richard/blakeBoyWhiteBoy.JPG\\\",\\\"/richard/dadSawyer.JPG\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Emily-Rose Perry\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"I love the blake boy white boy piece, who's that by?\\\"},{\\\"user\\\":\\\"Reese Slater\\\",\\\"rating\\\":4,\\\"comment\\\":\\\"That kid is drippin tbh\\\"}]},{\\\"name\\\":\\\"Sawyer\\\",\\\"description\\\":\\\"Sawyer is my lil guy (brother). He's the most wonderful ball of joy you've ever seen. He used to have a brace for his scoliosis before he had surgery, and he would have us hit it and tell us he couldn't feel a thing. The kid is a trooper, and I love him like hell. There's a picture of him in a dress and a big hat from his baptism lookin adorable. There's one where he asked me to put lipstick on him, and Dean is sitting there on edge worried that he'd be involved... Some of my favorites are the baby pic of him in the dirt, the one of him hanging at camp\\\",\\\"date\\\":\\\"December 2010\\\",\\\"paths\\\":[\\\"/sawyer/sawyer1.JPG\\\",\\\"/sawyer/sawyer2.JPG\\\",\\\"/sawyer/sawyer3.JPG\\\",\\\"/sawyer/sawyer4.jpg\\\",\\\"/sawyer/sawyer5.JPG\\\",\\\"/sawyer/sawyer6.mp4\\\",\\\"/sawyer/sawyer7.JPG\\\",\\\"/sawyer/sawyer8.JPG\\\",\\\"/sawyer/sawyer9.JPG\\\",\\\"/sawyer/sawyer10.JPG\\\",\\\"/sawyer/sawyer11.jpg\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Simra Portillo\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"He's so cute omg!\\\"},{\\\"user\\\":\\\"Aine Maldonado\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"An actor and a flier, how incredible\\\"},{\\\"user\\\":\\\"Dean\\\",\\\"rating\\\":1,\\\"comment\\\":\\\"_grumbles_ purple _grumbles_\\\"},{\\\"user\\\":\\\"Harriet Holcomb\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"Surely a genius, must have cool siblings\\\"}]},{\\\"name\\\":\\\"Podcast\\\",\\\"description\\\":\\\"Back in highschool, me and my buddies thought it'd be fun to make a podcast doing hip hop album reviews (naturally). We were doing them on a weekly basis, and it was some of the most fun that I've ever had. There was one episode where a few of our friends came by, and our friend Kay spilled water on my interface and broke it, so after we got set back up for the next week we thought it would be fun to make a diss track. Sean, as per his nature, veered off to talk about someone at Jos. A Bank that made fun of his socks and sandals.\\\",\\\"date\\\":\\\"2015 through 2016\\\",\\\"paths\\\":[\\\"/squadcast/podcast1.JPG\\\",\\\"/squadcast/podcast2.JPG\\\",\\\"/squadcast/podcast3.JPG\\\",\\\"/squadcast/podcast4.JPG\\\",\\\"/squadcast/podcast5.MOV\\\",\\\"/squadcast/podcast6.JPG\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Manny Banks\\\",\\\"rating\\\":1,\\\"comment\\\":\\\"Yeah, it's me Manny. From Jos. A Banks. Yeah, the one who 'never came in handy' so you never said thanks. Screw you too kid\\\"},{\\\"user\\\":\\\"Shelley Espinoza\\\",\\\"rating\\\":4,\\\"comment\\\":\\\"Long time listener and big fan, but you dropped off the face of the planet. What gives?\\\"},{\\\"user\\\":\\\"Kaylin\\\",\\\"rating\\\":2,\\\"comment\\\":\\\"Kinda messed up that you made a diss track about me, ngl\\\"},{\\\"user\\\":\\\"Mahad Moreno\\\",\\\"rating\\\":3,\\\"comment\\\":\\\"Show is alright, audio kinda sucks.. you all kinda sound the same lol\\\"}]},{\\\"name\\\":\\\"West Covina\\\",\\\"description\\\":\\\"Last Spring, Brooke and I made a last minute call to hop down to the city and see the Crazy Ex Girlfriend Live Show, which was incredible! The cast is all so sweet (love u rachel bloom), and spending time with Brooke is always great too. We met up with her old friend Michael over at NYU for some lunch and tea, and ended up getting stranded overnight in Penn Station\\\",\\\"date\\\":\\\"Spring 2019\\\",\\\"paths\\\":[\\\"/westCovina/westCovina1.jpg\\\",\\\"/westCovina/westCovina2.jpg\\\",\\\"/westCovina/westCovina3.jpg\\\",\\\"/westCovina/westCovina4.jpg\\\",\\\"/westCovina/westCovina5.jpg\\\",\\\"/westCovina/westCovina6.jpg\\\",\\\"/westCovina/westCovina7.jpg\\\",\\\"/westCovina/westCovina8.jpg\\\",\\\"/westCovina/westCovina9.jpg\\\",\\\"/westCovina/westCovina10.jpg\\\",\\\"/westCovina/westCovina11.jpg\\\",\\\"/westCovina/westCovina12.jpg\\\",\\\"/westCovina/westCovina13.jpg\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Dominique Wicks\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"Omg is she signing a pill bottle?\\\"},{\\\"user\\\":\\\"Katie Alcock\\\",\\\"rating\\\":3,\\\"comment\\\":\\\"How come nobody really cared about the hamilton dude showing up\\\"},{\\\"user\\\":\\\"Millie Jensen\\\",\\\"rating\\\":4,\\\"comment\\\":\\\"KRISPY KREME !!!!\\\"},{\\\"user\\\":\\\"Tilly-Mae Carter\\\",\\\"rating\\\":4,\\\"comment\\\":\\\"Oh honey, you really bought the tickets the night before? Are you sure you're doing alright? Do you need to see someone?\\\"}]},{\\\"name\\\":\\\"Youngster Mary\\\",\\\"description\\\":\\\"Mary came home one day with this fit, looking like Youngster Joey from Pokemon. That's all I have to say...\\\",\\\"date\\\":\\\"Oct 10, 2017\\\",\\\"paths\\\":[\\\"/youngsterMary/youngsterMary.JPG\\\",\\\"/youngsterMary/youngsterMary2.JPG\\\"],\\\"reviews\\\":[{\\\"user\\\":\\\"Kira Reeves\\\",\\\"rating\\\":4,\\\"comment\\\":\\\"The ratatas had pretty bad IVs, but they had good natures, so eh\\\"},{\\\"user\\\":\\\"Kurtis Dunne\\\",\\\"rating\\\":5,\\\"comment\\\":\\\"Wow! I've been looking for this coat for years!! Gonna buy it soon\\\"},{\\\"user\\\":\\\"Brandi Reyes\\\",\\\"rating\\\":2,\\\"comment\\\":\\\"floowr is blue >:((((\\\"}]}]}\");\n\n//# sourceURL=webpack:///./src/assets/items.json?");

